INSERT INTO `ims_basic_reply` VALUES ('161', '759', '\n总裁营销兵法思维：只是你家生意不好，没有整个行业不好！\n[图片]\n你对新生事物嗤之以鼻，顽固的守着老一套的方法去运作，不懂得紧跟时代的发展去学习吗？\n你对于裂变营销这种词汇还是云里雾里，根本不想去了解吗？\n你的客户管理思维模式有随着这些年客户需求的增长而快速更新吗？\n对于‘裂变’二字，你有真正意义上去了解过吗？\n\n作为一名企业老板，你有做到每年坚持参加培训，让自己始终站在领先竞争者的高度上吗？\n想要进步吗？想知道下一步该怎么做吗？想要让企业永远不会被取代吗？\n[图片]\n请继续看下去……\n首先我们需要了解，什么叫做“总裁营销兵法”\n知识小课堂，看这里：\n总裁营销兵法实际就是引导单个用户通过社交分享（转发朋友圈、分享给好友等）带来多个新用户的营销行为。它最大的好处，是能通过尽可能低的成本获得最大限度的用户增长。这么这么来看有点就有很多了：省钱、促进分享、快速找到用户分享的切入点再来一次。\n一切裂变营销都基于两个前提条件：\n1、用户是基础\n你连种子都没有，还种什么胡萝卜？同理，我们想要做裂变，首先要发展一批种子用户。这群种子用户是不可能通过裂变获得的。（0怎么裂变？）但我们可以通过广告投放、公众号以及其他推广方式吸取第一批用户，这批用户的质量和体量决定了你裂变营销带来的效果。\n\n2、不是所有裂变营销都适合你的产品\n流量池这本书提到一个观点：「高频带高频」。就是指产品本身如果是用户使用频繁的产品，裂变的可能性就大。这时候我们持续频繁发点小福利，就会有大量用户进行裂变分享。例如美团、饿了么红包。\n相反，如果你的产品是房地产、汽车之类的高价低频次的产品，你每天给用户补贴个1块2块是没有意义的。这时候最好的做法是提高福利力度，或者将低频福利转化成高频福利，例如每月补贴加油券、洗车券等。\n总而言之，不同的产品需要结合不同的营销场景制定裂变营销方案。至少我们要保证有一批忠实的存量用户。一旦挖掘出合适的裂变玩法，裂变营销就会成为你最低成本的获客之道。\n\n当前热门的医美商业模式并点评了当前商业模式的利弊。\n有这么一句话：只是你家生意不好，没有整个行业不好！\n就像渠道医美一样，传统渠道模式代表机构，YMR、WK、RE、BH、FM等，级差分销渠道模式代表机构，HL、XMX、YHMD、JXK等，哪家不是赚的盆满钵满？赚不到的，往往是那些一味模仿但错过天时者！\n[图片]\n直客医院缺点\n1、运维');
